/* modal */
#modal{
display: none;
position: fixed;
width: 100%; height: 100%;
z-index: 3000;
left: 0; top: 0;
background-color: rgba(0,0,0,0.85);
}
#modal>.close{
  position: absolute;
  width: 35px; height: 35px;
  right: 35px; top: 35px;
  background-color: red;
}

#modal>section{
  position: fixed;
  width: 980px;
  left: 50%; top: 50%;
  padding: 35px 30px;
  box-sizing: border-box;
  background-color: #fff;
  margin: -200px 0 0 -490px;
}
#modal>section>h4{
  font-size: 25px;
  margin-bottom: 25px;
  text-align: center;
  color: #333;
}

#modal>section>div{
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
}

#modal>section>div>figure{
  width: 40%;
  text-align: center;
}
#modal>section>div>dl{
  width: 55%;
}
#modal>section>div>dl>dt{
  clear: both;
  float: left;
  width: 150px;
}
#modal>section>div>dl>dd{
  float: left;
  width: 350px;
  margin-bottom: 25px;
  padding-bottom: 20px;
  border-bottom: 1px solid #aaa;
}
